        "rainTyre": function() {
            /* new RainyDay({
              image: 'background-rain',
              enableSizeChange:	true
            }); */
            var canvas = document.getElementById('rain');
            if (!canvas) {
                return;
            }

            var ctx = canvas.getContext('2d');

            var W = window.innerWidth;
            var H = window.innerHeight;
            canvas.width = W;
            canvas.height = H;


            var md = 900;
            var drops = [];
            var angle = 0;

            setInterval(draw, 25);

            for (var i = 0; i < md; i++) {
                drops.push({
                    x: Math.random() * W,
                    y: Math.random() * H,
                    r: Math.random() * 1.1,
                    d: Math.random() + 4,
                })
            }

            function draw() {

                ctx.clearRect(0, 0, W, H);
                ctx.fillStyle = 'white';
                ctx.beginPath();

                for (var i = 0; i < md; i++) {

                    var f = drops[i]
                    ctx.moveTo(f.x, f.y);
                    ctx.arc(f.x, f.y, f.r, 0, Math.PI * 2, true);
                }
                ctx.fill();
                update();
            }

            function update() {

                angle += 0.01;

                for (var i = 0; i < md; i++) {

                    var f = drops[i];

                    f.y += Math.pow(f.d, 2) + 1;
                    f.x += Math.sin(angle) * 2;

                    if (f.y > H) {
                        drops[i] = { x: Math.random() * W, y: -10, r: f.r, d: f.d }
                    }
                }


            }
        },
        "rainTyreAlter": function() {
            $(document).ready(function() {
                new RainyDay({
                    image: 'background-rain',
                    enableSizeChange: true
                });
            })
        },
