    Drupal.behaviors.nitto = {
        attach: function(context, settings) {
            $('select', context).customSelect("select");

            $('.ajax-popup', context).click(function(event) {
                event.preventDefault();
                var target = $(this).data('target');
                $.magnificPopup.open({
                    items: {
                        src: '#wait2-popup',
                        type: 'inline'
                    }
                });
                $.ajax({
                    url: $(this).attr('href'),
                    success: function(html) {
                        $(target).html(html);
                        Drupal.attachBehaviors(target, {});
                        // func.slick();
                        $.magnificPopup.open({
                            items: {
                                src: target,
                                type: 'inline'
                            }
                        });
                    }
                });
            });

            $('.ajax-link', context).click(function(event) {
                event.preventDefault();
                var target = $(this).data('target');
                $.ajax({
                    url: $(this).attr('href'),
                    success: function(html) {
                        $(target).html(html);
                        Drupal.attachBehaviors(target, {});
                    }
                });
            });

            // Prettier embeds for YouTubes
            $().prettyEmbed({});

            if ($('#order-form .ext-link.submitted').length) {
                window.open($('#order-form .ext-link.submitted').val(), '_blank');
            }

            $(window).on('load hashchange', function() {
                if (window.location.hash) {
                    var el = window.location.hash;
                    if ($(el).length) {
                        $.magnificPopup.open({
                            items: {
                                src: el,
                                type: 'inline'
                            }
                        });
                        window.location.hash = '';
                    }
                }
            });
        }
    }
